function I = fcnK2B(S, t, u, alpha, F, tol)
t1 = 0.1e1 ./ u;t2 = 0.1e1 ./ F;t4 = F .^ 2;t6 = t .* F;t8 = sqrt(t4 .* S + t6 + u);t9 = 0.1e1 ./ t8;t11 = u .^ 2;t12 = 0.1e1 ./ t11;t16 = t .^ 2;t21 = 0.1e1 ./ (0.4e1 .* S .* u - t16);t32 = sqrt(u);t41 = log(t2 .* (0.2e1 .* t8 .* t32 + t6 + 0.2e1 .* u));t52 = -t9 .* t2 .* t1 - 0.3e1 ./ 0.2e1 .* t9 .* t12 .* t + 0.3e1 .* F .* S .* t9 .* t21 .* t12 .* t16 + 0.3e1 ./ 0.2e1 .* t9 .* t21 .* t12 .* t16 .* t + 0.3e1 ./ 0.2e1 .* t41 ./ t32 ./ t11 .* t - 0.4e1 .* t9 .* t21 .* (0.2e1 .* S .* F + t) .* t1 .* S;
I = t52(:,:,2) - t52(:,:,1);

end
